import React, {Component} from 'react';
import H1Components from './component'

class App extends Component{
    
    render(){
        var namesArray = ["ivica", "pedza", "vesna", "dekso"]
        const h1Component = namesArray.map((item) => <H1Components key={item} text={item} />);
        
        
       
        return (
            
            <div className="mainDiv container-fluid text-center justify-content-center">
                <div className="row">
                    <div className="col-6">
                     <ul>
                         {h1Component}
                     </ul>
                    </div> 
                    <div className="col-6">
                    <ul>{h1Component}</ul>
                    </div>
                </div>
            </div>
            
        )
    }
}

export default App;
